export class dragon {
    constructor(entityID, Name, Origin, Style, Wings, Legs, Length, Weight, Flight, Magical) {
        this.entityID = entityID;
        this.Name = Name;
        this.Origin = Origin;
        this.Style = Style;
        this.Wings = Wings;
        this.Legs = Legs;
        this.Length = Length;
        this.Weight = Weight;
        this.Flight = Flight;
        this.Magical = Magical;
    }
}
